        "text" : "Dear Sir,\n\nIs really nice meeting you sir and It is my greatest pleasure to introduce to you this business opportunity of supplying our company animal vaccine from India with a huge profit net which will be shared equally among us. I am an employee of Animal Home Zoological Ghana LTD.\n\nThere is an animal drug which our company ran out of the stock which is used in production of general drugs and injection for the animals and is only found in India since we started making use of the medicinal supplement.  I only have the contact \naddress of the Local Dealer in India because I worked with the former director of our company before this present one came into existence.\n\nThe business deal is that, Recently I found out that this same Vaccine is sold by the Indian  manufacturer at the rate $35,000,00 USD per Liter to my former boss, while in my file is recorded for $65,000,00 per liter, that is when i discovered the business game our former director is playing at the expense of our company, then i also decided to take advantage of it since am the only person with the contact information of this same local manufacturer in India. \n\nTherefore be rest assured our new company chairman will be willing to buy it for $65,000,00 per liter as the need for the usage is rising on daily bases and he still could not find the manufacturer.  I intend to present you as a supplier who will be a Middleman between our company and the local vendor in India so that my company will not know the main-source of the material.\n\nMeaning you will contact our company with the interest to supply this animal vaccine from India who came across a publication in Ghana chambers of commerce on the urgent need for the said animal vaccine.\n\nYour role must be played perfectly and the least I expect from you is betrayal. I don’t want my organization to know the contact address of this local dealer in India as well as the real cost of the product because of these personal interests.\n\nDo revert back with your interest if you can play the role and I will forward the whole detail to you immediately, but if you're not interested kindly indicate so that I will sort for someone else. But in case there are things you did not understand as per my mail explanation, kindly call me so that we can express more.\n\nYours Faithful,\nDr. Isidore Yaw Jnr\nIsidoreYaw@outlook.com \n+233559058973",
