        "urls" : [ {
          "url" : "https://t.co/ErX4AhFvqc",
          "expanded" : "https://www.inittogether.nyc/",
          "display" : "inittogether.nyc"
        } ],
        "text" : "https://t.co/ErX4AhFvqc connects healthy volunteers with the organizations that need them most, like City Harvest. Volunteering is  more crucial than ever. This is something we can do today and make a real difference.",
