        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "Hey, looping back around for 2 reasons: 1) would love to find time to catch up now that 2020 is upon us and 2) how do you feel about unsolicited investment pitches these days? someone I know from the awesome foundation wanted me to forward you an email, so I thought I'd see whether you're at all interested. Looking forward to catching up!",
