        "reactions" : [ ],
        "urls" : [ ],
        "text" : "thank you so much for this; talked to the team about it this morning. think i'll do some more digging on Alex. and you're right - Jason was a cold lead sent by someone, but realized he had just started officially a few weeks ago",
