        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "Jason I only know from one interview meeting, he was my replacement. Early feedback is that he is well-liked by the team. It's kind of alarming that he is looking for a new situation less than 3 weeks after starting at Capsule. Or is he just a cold lead you are prospecting?",
