  "dmConversation" : {
    "conversationId" : "5215-161157626",
    "messages" : [ {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ {
          "url" : "https://t.co/o8kx2jFERL",
          "expanded" : "https://twitter.com/DuckDuckGo/status/1228692189519192065",
          "display" : "twitter.com/DuckDuckGo/sta…"
        } ],
        "text" : "You seem to pretty heavily leverage the cloud for a lot of your stuff (how your pix used to be on Dropbox, your quantified self analysis, just the use of useFYI, etc), as I am.  Ever any concerns about these sorts of breaches, or precautions taken? I'm always looking for tips and ways to more safely benefit from the great convenience of the cloud.  https://t.co/o8kx2jFERL",
        "mediaUrls" : [ ],
        "senderId" : "161157626",
        "id" : "1228693673828851716",
        "createdAt" : "2020-02-15T14:52:54.589Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "161157626",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "cheaper",
        "mediaUrls" : [ ],
        "senderId" : "5215",
        "id" : "1228054193853825033",
        "createdAt" : "2020-02-13T20:31:50.672Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "161157626",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "\"Great on a Kindle\" - i started doing this every so often too. it's a good idea and a good way to pick up books chaper.",
        "mediaUrls" : [ ],
        "senderId" : "5215",
        "id" : "1228054183414288391",
        "createdAt" : "2020-02-13T20:31:48.163Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ {
          "url" : "https://t.co/N1VqD00UNe",
          "expanded" : "http://scribd.com",
          "display" : "scribd.com"
        } ],
        "text" : "and I've found https://t.co/N1VqD00UNe is good for audiobooks.  havent' read as many books on there, but it does have a fair amount of audio books for the $8.99/month subscription.",
        "mediaUrls" : [ ],
        "senderId" : "161157626",
        "id" : "1228053414107635718",
        "createdAt" : "2020-02-13T20:28:44.784Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "Also \"Prime Reading,\" which comes with Amazon Prime, gives you access to certain titles like a library",
        "mediaUrls" : [ ],
        "senderId" : "161157626",
        "id" : "1228053141427511300",
        "createdAt" : "2020-02-13T20:27:39.734Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "Thanks. Amazon has this \"Great on a Kindle\" thing, too.  So if there are a few recent books that qualify for \"great on a kindle\" you want to buy, you can buy one and then get credits towards other \"great on kindle books.\" I haven't entirely figured that out yet, but if you had four or five books that are all \"great on kindle\" you can stack the purchases of them within a month and get them below normal price.",
        "mediaUrls" : [ ],
        "senderId" : "161157626",
        "id" : "1228053043456946181",
        "createdAt" : "2020-02-13T20:27:16.372Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "161157626",
        "reactions" : [ ],
        "urls" : [ {
          "url" : "https://t.co/AXuWCwTAXd",
          "expanded" : "https://naveen.blog/2019/02/borrowing-e-books-from-nypl/",
          "display" : "naveen.blog/2019/02/borrow…"
        } ],
        "text" : "also, if you want to borrow books and audiobooks instead of buying them https://t.co/AXuWCwTAXd",
        "mediaUrls" : [ ],
        "senderId" : "5215",
        "id" : "1228018596556787717",
        "createdAt" : "2020-02-13T18:10:24.116Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "161157626",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "really, far and away the best way to read these days is Kindle (if you want electronic)",
        "mediaUrls" : [ ],
        "senderId" : "5215",
        "id" : "1228018488389840901",
        "createdAt" : "2020-02-13T18:09:57.846Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "161157626",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "but these days, the Kindle app is really good about tallying your days-read, number of pages, and giving you all sorts of other stats.",
        "mediaUrls" : [ ],
        "senderId" : "5215",
        "id" : "1228018428226785290",
        "createdAt" : "2020-02-13T18:09:43.470Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "161157626",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "the old reading (~20 years ago) that got me started on quantified self was all books (college books and books at home) - those were all manually counted into a spreadsheet",
        "mediaUrls" : [ ],
        "senderId" : "5215",
        "id" : "1228018350867013636",
        "createdAt" : "2020-02-13T18:09:25.036Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "Naveen - always enjoy your blog posts. I read the super organizers interview and your recap of reading for 2019 - are you doing all this reading the iPhone or iPad? Especially when you did that tracking off how many pages - was it all electronic? Always curious how others get all their reading in. Thanks.",
        "mediaUrls" : [ ],
        "senderId" : "161157626",
        "id" : "1227964230839787525",
        "createdAt" : "2020-02-13T14:34:21.868Z"
      }
    } ]
  }
