        "text" : "This is Way, having a great online financial education project with amazed advantages. Introduction:   As the director of the Chelsea98 Investment Group I want to introduce you to an exciting investment opportunity that has enormous growth potential. We are building an entirely new financial education product. Our education platform offers investors like you an unequalled opportunity to be a part of a ground-breaking new way to offer financial education to professional and retail investors alike.\n  Currently most financial education is done through traditional teaching methods. This is expensive, slow and inflexible. To better serve the quickly growing market of casual investors, in particular those in China, we have built a platform that is highly scalable, responsive and ideally suited to this largely untapped market.\n  Formed after years of research, our internet based platform is positioned to become a world leader. Accessible through mobile phones, laptops and other Internet accessible devices, the growth potential of our platform is limited only by the internet’s reach.\n  Our team is built of top financial university professors, experienced traders and talented business people. Our IT professionals have had extensive experience building online education platforms, including those used by Beijing’s elementary school system. As director of Chelsea98, I have over 8 years of trading experience in stocks, foreign exchange and options. I hold two bachelor degrees in Industry Management and Administration from York University, and an EMBA from Tsinghua University. Together, our team of seasoned professionals provides the knowledge and expertise required to build a financial education product that will be a world-wide industry leader.\n  We would like you to be part of this. We are seeking $1 million U.S. dollars in funding in exchange for a 25% share of our business. These funds are to be used for course creation, marketing and platform develoment. Our initial rollout will be to the United States, Canada and China. With a combined population of 1.7 Billion people, representing 300 million private investors, the market is huge. Without any strong competitor in the online finance education industry, we have first-to-market advantage.\n  As governments around the world encourage their citizens to become active investors with numerous financial products like RRSP’s, RESP’s, and TFSA, the need to educate people becomes ever more important. Our goal is to be the foremost provider of that education.\n   \n           “Enjoy the ease of learning and earnings from Chelsea98 Online Finance Educational Platform”\n   \n  Way Liu\n  Director\n  Chelsea98 Investment Group Ltd. \n  101# 1001 Denison St. Markham, On               liuvv@yahoo.com                              416.854.1668",
