        "reactions" : [ ],
        "urls" : [ ],
        "text" : "Hi Naveen,\n\nHolidays are coming! And we, Colorwhistle wish you a great one!. My name is Anjana and I’m part of the marketing team at ColorWhistle.\n\nWe are planning to write a roundup post on business resolution 2018, and we require few sentences from innovative entrepreneurs to add to our post. The question is:\n\nWhat is your business resolution for 2018?\n\nIt would be great to have your input. Our audience would love to hear your insight and budding entrepreneurs will also benefit from it. We’ll also give a backlink to a link of your choice.\n\nI know you get a lot of messages but, I would be very happy if you could share yours by next week as we plan to publish it by the year-end.\n\n If you're too busy to answer, I totally understand.",
