  "dmConversation" : {
    "conversationId" : "5215-1022151516",
    "messages" : [ {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ {
          "url" : "https://t.co/c4gWE5NIBJ",
          "expanded" : "http://www.skopr.com",
          "display" : "skopr.com"
        } ],
        "text" : "Naveen,\n  Elevator pitch for two (OK maybe three) story building:\n  1.     Employers will spend $15 billion in 2020 (up from $10 billion today) on employer branding and another $13 billion (up from $7 billion today on bottom up basis) on talent acquisition tools (LinkedIn, Indeed, Taleo, ICIMs etc.)\n  2.     Employer branding spend is scattershot—supposed to drive talent acquisition but in reality metrics show little torque transfer.\n  3.     This disconnect between branding and talent acquisition opens a $3 billion opportunity gap that we can fill and dominate through an integrated service.  It would connect  branding and talent acquisition in a demonstrably effective fashion.\n  Much more than an idea (prototyped), less than a commercial product.  Core team has domain expertise in markets, recruiting and technology.  Validated product/market fit with knowledgeable industry veterans.  FB has invited us to revert to them pre-launch as potential customer.  \n  Expa’s model appears to us as a significantly better alternative to angel funding because of access to connections and advice.\n  Hope to connect even if it is not an obvious sweet spot for Expa.\n  Arvind Rajkumar\n  M: 917-864-9417\n  arvind@skopr.com\n  https://t.co/c4gWE5NIBJ\n  skype: arajis@outlook.com",
        "mediaUrls" : [ ],
        "senderId" : "1022151516",
        "id" : "773293395100000263",
        "createdAt" : "2016-09-06T22:54:47.329Z"
      }
    } ]
  }
