        "recipientId" : "652193",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "i can't imagine having an office without also having them in there. i really like the ipad in the kitchen model as well: you want \"the thing in the room, not just the thing in the cloud\" which no-one ever sees. the ipad here also is a good conversation starter - as well as the thing that reminds you to check in every time you are in the kitchen",
