        "recipientId" : "2478067758",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "i just placed the order (396287) for the Premium white+white desk as well as a cable tray. i'll come back for the monitor arm and other things after i figure out the display and how i end up setting it up!",
