        "urls" : [ ],
        "text" : "Hello Naveen,\n\nWhile evaluating Foursquare as a competitor, I found about you and Expa Labs. I'm a 21 year old entrepreneur working on mobile platform that spontaneously connects the entire human race via agile local events.Essentially, allowing people to meet whoever they want, whenever they want, whereever they want and however they want.\n\nAs I couldn't find a contact, I was wondering if Expa Labs accepts application from single founders? Would you like an investor deck or is this something you might be interested in? \n\nKind regards,\nEashan",
