        "text" : "What steps would you suggest for me to take to try to get better connected? I have tried sending emails to countless amounts of people for numerous companies and I am struggling to find a way to 'get my foot in the door'. What books do you read? What has impacted you the most? If I were to look for a job or internship with one of your companies, where would I be able to apply?",
