        "text" : "I am a practicing physician and healthcare entrepreneur and love some of your companies including spot, operator and reserve. Which is the sort of experience I want to provide the healthcare consumer. Would like to have you join a talented group of advisors including hospital CEO, thought leaders and innovators. And more based on your interest. As a MVP we have stitched together a couple of functionalities across acute (Emergency Room or Urgent Care), chronic (well visits or care for diabetes, stable heart condition etc) and complex care (cancer and rare conditions). As an example for chronic care: 1) Recommended Doctors (we recommend using best available quality data)  2) Sort by geography, cost etc 3) Book online  4) Self service tools.    https://t.co/ILslAWMQjq   https://t.co/qKoyZpfKba  https://t.co/sQQsU5ByC1   https://t.co/WvK3ziYaBg",
