        "urls" : [ {
          "url" : "https://t.co/v4Bu0J9oic",
          "expanded" : "https://twitter.com/mariodgabriele/status/1328732563784011779",
          "display" : "twitter.com/mariodgabriele…"
        } ],
        "text" : "Hey Naveen - hope you're well! \n\nSorry to trouble but was wondering if you might able to lend a hand on something. \n\nI'm entering the final stages of Product Hunt today and looks like I have a shot of snagging the #1 spot! Totally cool if not, but if you feel comfortable would you be down to RT or quote tweet this? \n\nhttps://t.co/v4Bu0J9oic",
