  "dmConversation" : {
    "conversationId" : "5215-3313708970",
    "messages" : [ {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "I am very excited about this app, and I believe it will be a huge success!!!  I recently moved to Buenos Aires, Argentina and will greatly benefit from the connections that JETZY will provide.  Now is a perfect time to get involved in our company, as it will grow very rapidly. I would like to send you our executive summary to give you a bit more information.  Please let me know if you are interested in more information and a meeting with our founders.  Have a great day!",
        "mediaUrls" : [ ],
        "senderId" : "3313708970",
        "id" : "634792515007344643",
        "createdAt" : "2015-08-21T18:21:44.159Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "I thought I would reach out as we are in the process of raising funds and want to see if you have an interest. \n\nJetzy is the world’s first real time, user to user, social app to connect travelers and locals globally by location and reward users with free travel for using the app. People can connect to exchange information, photos or even meet in person. \n\nJetzy's seed investor is a top facebook executive and now some more people from facebook and google are getting involved. The platform is picking very fast and pre-launch we have acquired approx 215,000 followers within 23 weeks of starting our social media pages. 45 travel business have sponsored rewards for our users ranging from free dinners or spa vouchers to free trips to Tahiti all inclusive ($28,000 trip). Hundreds of people have pre-registered for the app and several institutions are under discussion for forming private groups on Jetzy including Harvard alumni, Goldman Sachs Alumni, Michigan Business School MBA students etc.",
        "mediaUrls" : [ ],
        "senderId" : "3313708970",
        "id" : "634792410669821955",
        "createdAt" : "2015-08-21T18:21:19.288Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "5215",
        "reactions" : [ ],
        "urls" : [ ],
        "text" : "Hello Naveen,\n\nI'm representing Jetzy; world’s first REAL TIME, social app to CONNECT travelers &amp; locals globally by location and REWARD on usage. Jetzy's founders serial entrepreneurs, seed investor top Facebook exec, getting interest from Google execs. We're raising funds. Can we discuss?",
        "mediaUrls" : [ ],
        "senderId" : "3313708970",
        "id" : "634792282865205251",
        "createdAt" : "2015-08-21T18:20:48.817Z"
      }
    } ]
  }
