        "text" : "I have a pretty simple mental model with buying bikes. 1) I find it hard to have more fun than riding a bike alone or with my kids and there is real positive health benefits. 2) Resale value is really good and liquid. You pay it forward by selling it at a slight discount to the next buyer. Down for a hike, the family wants to meet more people for sure. Also beach is super safe with the kids from what I've found, we are in.",
