        "urls" : [ ],
        "text" : "I will be attending the upcoming TechCrunch Disrupt NY event and see that you are a speaker. I am the Managing Partner of True Exec, an interactive digital platform for business executives to share actionable advice.\n\nOur audience is mainly comprised of decision-makers at mid-size growing companies, as well as private equity groups, executive thought leaders, undergraduate business schools / MBA programs, and entrepreneurs. We believe these people want to hear from others who have been there and done that. \n\nThe content includes videos, blogs, and files that hit on topics such as Forecasting &amp; Budgeting, Raising Capital, Leadership &amp; Management, Recruitment &amp; Hiring, Marketing &amp; Branding, etc.\n\nWe are reaching out to “thought leading experts” and would love to add you to the list. Some of the people we have interviewed thus far include:\n\n- Lee Iacocca (Former CEO, Chrysler)\n- Chris Nassetta (CEO, Hilton Worldwide)\n- Alessandro Isolani (Founder, Ebates)\n- Rick Sarmiento (Founder, White House | Black Market)\n- Jay Gruden (Head Coach, Washington Redskins)\n- Larry King (TV Personality)\n\nIf possible, we would like to schedule a brief video interview with you at some point during TechCrunch Disrupt NY. The interview should only take about 45 minutes. Please let me know when you may be available.\n\nBest,\n\nElizabeth Venafro",
