        "text" : "◆జై శ్రీ రామ◆\n                ◆మన దేశ భద్రత కోసం◆\n          మనదేశంలో జరుగుతున్న\n1)అరాచకాలు,\n2)దొంగతనములు,\n3)దొంగనోట్ల తయారుచేయడం \n4)నక్షలేట్లు,\n5)ఉగ్రవాదులు,\n6)హత్యలు,\n7)మనబంగాలు,\n8)కిడ్నప్లు చేయడం,\n9)బంగారం ఎత్తుకెలడం,\n10)సంపాదించిన డబుకు టాక్సకట్టకపోవడం          11)మున్సిపల్ టాక్సీ కటకపోవడం,\n12)వరదలు రాకుండా వచ్చినపుడు ప్రాణనష్టం కాకుండా,\n13)ఎర్రచెందనం చెట్లు కొట్టకుండా,\n14)వరకట్నం వేధింపులు రాకుండా చేయడం,\n      పైన రాసినవాటిని అరికటే విధంగా ఇవన్నీ అమలు అయితే మన దేశ భద్రతలో 100 సంవత్సరాలు ముందు అక్రమనిలువలు లేకుండా చేయబడును\n               ◆మన దేశ అభివృద్ధి కోసం◆\n1)వ్యవసాయలు అభివృద్ధి చెందేవిధంగా 2)భూముల ధరలు తగ్గేవిధంగా\n3) నిత్యవసర వస్తువుల ధర తగ్గేవిధంగా 4)ప్రతిఒక్కరు బ్యాంకు సహాయం పొందేవిధంగా 5)R B I బ్యాంకు 70శాతం లాభం పొందేవిధంగా\n6)మనదేశంలో పుటినవారికీ ఓటు హక్కు ఉంటే ప్రపంచంలో ఎక్కడ ఉన్న ఓటు వేసేవిధంగా\n7)మన దేశానికి దిగుమతి చేసే బంగారాన్ని దాన్ని కన్నా తక్కువగా ఉండేవిధంగా బంగారం అమ్మవచ్చును \n8)B S N L అధిక లాభం పొందేవిధంగా \n9)ప్రతి వ్యాపారి నష్టపోకుండా ప్రతి వ్యాపరికి బాకీ లేకుండా ప్రతి ఒక్కరు ఖర్చులో 25 సంవత్సరాలు వెనుకకు ఉండేవిధంగా ఇవన్ని మన స్టేట్ గవర్నమెంట్ మరియు సెంట్రల్ గవర్నమెంట్ నుండి అమలు కావాలి\n                ఇట్లు\n              K.shanker\nFrom:krishnanagar jagtial.                  my birthday:October 2nd \n        H no:1-3-30/3 \n      Dist:karimnagar\n         9247776326\n           Telangana\n      meru share cheyande",
